import React from 'react';
import {Input , Button, InputGroup, InputGroupAddon} from 'reactstrap';
import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <div>
    <InputGroup>
      <Input />
      <InputGroupAddon addonType='append'><Button>Send!</Button></InputGroupAddon>
    </InputGroup>
    </div>
  );
}

export default App;
